import React from 'react';
import Card from '../Card';
import s from './CardList.module.css';

const CardList = ({item = []}) => {
    return (
        <div>
            <div className={s.container}>
                <h2>Найпопулярніший тур цього місяця <br />«Старий Львів»</h2>
                <div className={s.cards}>
                    <div className={s.numbers}>
                        <div className={s.circle}>1</div>
                        <div className={s.circle}>2</div>
                        <div className={s.circle}>3</div>
                    </div>

                    <div>
                        {
                            item.map(({text, descr, photo, map}, index) => <Card key={index} text={text} descr={descr} photo={photo} map={map}/>)
                        }
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CardList;
